            return true;
        }
        boolean increasing = l.get(1) > l.get(0);
        for (int i = 2; i < l.size(); i++) {
            if (increasing) {
                if (l.get(i) < l.get(i - 1)) {
                    return false;
                }
            } else {
                if (l.get(i) > l.get(i - 1)) {
                    return false;
                }
            }
        }
        return true;

